import styles from './Intro.module.css'
import TopicName from './TopicName';
function Skills() {
    return (
        <div className={styles.grand_wrapper}>
            <div className={styles.helper}>
                <TopicName title={"My_Skills"}></TopicName>
            </div>
            {/* <br /> */}
            <div className={styles.wrapper} style={{ backgroundColor: "#242734" }}>
                <div className={styles.left} style={{minWidth:"80vw"}}>
                    {/* <div className={styles.name}> <span className={styles.yellow}></span> I'm Asif Tanvir</div> */}
                    <div className={styles.info}> Thank you for scrolling to the bottom</div>
                    <div className={styles.info_main} style={{minWidth:"80%"}}>I personally feel like I have still got a long way to go before I can comment on my skills. I genuinely enjoy grinding DSA on LeetCode, and solving adhoc questions on Codeforces. C++ is my preferred language of choice
                        Being the linux enthusiast I am, I have found comfort in using tools like Docker and Podman for creating conflict free applications packaged into an image. I do web development too, with React being my preferred Front-End Framework. For Backend, I am comfortable with springboot, flask, express.
                    </div>
                    <div className={styles.dash}></div>
                    <div className={styles.socials}>
                        <div>󰌻 󰊤</div>
                        <div className={styles.smallImg}></div>
                    </div>
                </div>

            </div>
        </div>


    )
}
export default Skills;
